description:
Funções do Aparelho: 



- Lixar e polir as unhas; 

- Secagem rápida das unhas. 



Benefícios que este Aparelho Oferece: 

- Secador de unhas embutido; 

- 11 acessórios para tratar as unhas: 1 Escova, 2 Polidores, 1 Espátula, 2 Lixas Cônicas, 1 Lixa Cilíndrica e 4 Lixas em disco. 

- Design arrojado que mantém os acessórios organizados no próprio aparelho; 

- Aparelho recarregável na energia elétrica; 

- Garantia de 1 ano.
